import { useParams } from "react-router-dom";
import { Link } from 'react-router-dom';


const ArticleInfo = ({articles}) => {
  const { _id } = useParams();
  return (
    <div>
      <p>composant article info</p>
      <p>je suis l'id {_id}</p>

      {articles.map((article) => {
        return (
          <div key={article._id}>

              <p>{article._id}</p>
          </div>
        )
      })}
    </div>



  )
}

export default ArticleInfo
